import React from 'react';

import TextField from '@material-ui/core/TextField';

export const Form = () => {

  return (
    <form noValidate autoComplete="off">
      <TextField label="Name" variant="outlined" />
      <TextField label="Email" variant="outlined" />
    </form>
  );
};
